oxy_webhelp_navlinks = {"sec_ecl_t-d4800e7980":{"topics":[{"title":"ECL security access options","shortdesc":"<p class=\"shortdesc\">You can set access options in HCL Notes® for Workstation security, Java™ applet, or JavaScript™.<\/p>","href":"sec_ecl_options_c.html","attributes":{"data-id":"sec_ecl_options_c"},"menu":{"hasChildren":false},"tocID":"sec_ecl_options_c-d4800e8001","topics":[]},{"title":"To view a name's effective access in the ECL","shortdesc":"<p class=\"shortdesc\">The effective access a person or a group has to the workstation ECL is not always apparent. For example, you may have granted temporary access to a group that designed a database application that you are working in. This access is valid for the duration of a session, but if that session lasts all day, you may want to refresh your memory of who has been granted ECL rights on your workstation. With one click, you can determine a person's, or group's, effective access in your ECL.<\/p>","href":"sec_ecl_vieweffective_t.html","attributes":{"data-id":"sec_ecl_vieweffective_t"},"menu":{"hasChildren":false},"tocID":"sec_ecl_vieweffective_t-d4800e8025","topics":[]},{"title":"Execution security alert","shortdesc":"<p class=\"shortdesc\">The Execution Security Alert dialog box is a warning message. It lets you know that someone has requested an action that he or she is not allowed to execute because of what you specified in your Execution Control List.<\/p>","href":"sec_ecl_alert_c.html","attributes":{"data-id":"sec_ecl_alert_c"},"menu":{"hasChildren":false},"tocID":"sec_ecl_alert_c-d4800e8040","topics":[]}]}};